import React from "react";
import Filter from "./Filter";

const Filters = (props) => {
    return (
        <div class="btn-group btn-group-lg gap-5" role="group">
            <Filter text="Nature"/>
            <Filter text="Buildings"/>
            <Filter text="Monuments"/>
            <Filter text="People"/>
            <Filter text="Car"/>
            <Filter text="Flowers"/>
            <Filter text="Flowers"/>
        </div>
    );
}

export default Filters;
